import React, { Component } from 'react'

import { RadialBarChart, RadialBar, Legend } from 'recharts';

import {
  Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis,
} from 'recharts';

const data = [
  {
    subject: 'Menthe', A: 120, B: 110, fullMark: 150,
  },
  {
    subject: 'Cannel', A: 98, B: 130, fullMark: 150,
  },
  {
    subject: 'Thé', A: 86, B: 130, fullMark: 150,
  },
  {
    subject: 'Vanille', A: 99, B: 100, fullMark: 150,
  },
  {
    subject: 'Jasmin', A: 85, B: 90, fullMark: 150,
  },
  {
    subject: 'Oigon', A: 65, B: 85, fullMark: 150,
  },
];


class Cardquatre extends Component {

  render () {

    return (
      <div className='Cardquatre'>
        <h3>Parfums</h3>

        <center>
        <RadarChart cx={200} cy={200} outerRadius={100} width={450} height={450} data={data}>
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" />
        <PolarRadiusAxis />
        <Radar name="Mike" dataKey="A" stroke="#FDECA2" fill="#FEC89D" fillOpacity={0.6} />
      </RadarChart>
        </center>

      </div>
    )
  }
}

export default Cardquatre
